import axios from "axios";



export const getUsers = (carrentPage: number, pageSize: number) => {
    return axios.get(`https://social-network.samuraijs.com/api/1.0//users?page=${carrentPage}&count=${pageSize}`, {
        withCredentials: true,
    }).then(response => {
        return response.data
    })

}
